import React from 'react';
import Outline from './Outline';

const Modules = ({ dynamic_modules }) => {
    if (!modules || !Array.isArray(dynamic_modules)) {
        return <div>No modules provided</div>;
    }

    return (
        <div>
            {modules.map((module, index) => (
                <Outline key={index} title={module.title} content={module.content} />
            ))}
        </div>
    );
}


export default Modules;
